        <div class="overlay"></div>
        <div class="search-overlay"></div>
        <BeginSidebar/>
        <ContentArea/>


    </div>
    {/* END MAIN CONTAINER */}
    {/* END MAIN CONTAINER */}

    {/* BEGIN GLOBAL MANDATORY SCRIPTS */}

    {/* BEGIN PAGE LEVEL PLUGINS/CUSTOM SCRIPTS */}

    </div>
  );
}

export default App;
